  `access` varchar(16) DEFAULT NULL COMMENT '용도 (public, private)',
  `permission` varchar(16) DEFAULT NULL COMMENT '권한 (normal, blocked, password)',
  `create_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '생성일시',
  `modify_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '수정일시',
  PRIMARY KEY (`_id`)
